import { useState } from "react";
import styled from 'styled-components';
import Header from "../../components/Header";
import DashBoard from "../Dashboard";
import Clientes from "../Clientes";
import img from '../../assets/imagens/logo.png'

// Ícones - você precisará importar ou definir os ícones correspondentes
import dashboardIcon from '../../assets/imagens/dashboard.png';
import agendaIcon from '../../assets/imagens/agenda.png';
import clientesIcon from '../../assets/imagens/clientes.png';
import servicosIcon from '../../assets/imagens/servicos.png';
import configuracoesIcon from '../../assets/imagens/configuracoes.png';

const PagBase = styled.section`
  display: flex;

  .menu-lateral {
    height: 100vh;
    width: 20vw;
    background-color: #f8f9fa;
    box-shadow: 2px 0 5px rgba(0,0,0,0.1);
  }

  .menu-lateral ul {
    padding: 20px;
    border-top: 1px solid #e1e1e1;
    list-style: none;
  }

  .menu-lateral h2 {
    padding: 20px;
    margin-bottom: 22px;
    display: flex;
    align-items: center;
    justify-content: center;
  }

  .minhas-tarefas {
    width: 80vw;
  }

  .filtro-menu-lateral {
    display: flex;
    align-items: center;
    background: none;
    border: none;
    padding: 12px 16px;
    margin: 5px 0;
    cursor: pointer;
    font-weight: 500;
    color: #6c757d;
    border-radius: 5px;
    transition: all 0.3s;
    width: 100%;
  }

  .filtro-menu-lateral:hover {
    color: #000;
    background-color: #e9ecef;
  }

  .filtro-menu-lateral.ativo {
    color: #000;
    background-color: #e9ecef;
    font-weight: 600;
  }

  ul li img {
    width: 20px;
    margin-right: 15px;
  }

  h2 img {
    width: 200px;
  }

  h1 {
    font-size: 35px;
  }
`;

function PaginaBase() {
  const [filtro, setFiltro] = useState("dashboard");
  const [pagina, setPagina] = useState("dashboard");
  const [titulo, setTitulo] = useState("Dashboard");

  const paginas = {
    dashboard: <DashBoard setPagina={setPagina} setTitulo={setTitulo} setFiltro={setFiltro} />,
    clientes: <Clientes />,
    // Adicione outras páginas conforme necessário
  };

  return (
    <PagBase>
      <section className="menu-lateral">
        <h2><img src={img} alt="Logo" /></h2>
        <ul>
          <li 
            onClick={() => {
              setTitulo("Dashboard");
              setFiltro("dashboard");
              setPagina("dashboard");
            }} 
            className={`filtro-menu-lateral ${filtro === "dashboard" ? "ativo" : ""}`}
          >
            <img src={dashboardIcon} alt="Dashboard" />
            Dashboard
          </li>
          <li 
            onClick={() => {
              setTitulo("Agenda");
              setFiltro("agenda");
              setPagina("agenda");
            }} 
            className={`filtro-menu-lateral ${filtro === "agenda" ? "ativo" : ""}`}
          >
            <img src={agendaIcon} alt="Agenda" />
            Agenda
          </li>
          <li 
            onClick={() => {
              setTitulo("Clientes");
              setFiltro("clientes");
              setPagina("clientes");
            }} 
            className={`filtro-menu-lateral ${filtro === "clientes" ? "ativo" : ""}`}
          >
            <img src={clientesIcon} alt="Clientes" />
            Clientes
          </li>
          <li 
            onClick={() => {
              setTitulo("Serviços");
              setFiltro("servicos");
              setPagina("servicos");
            }} 
            className={`filtro-menu-lateral ${filtro === "servicos" ? "ativo" : ""}`}
          >
            <img src={servicosIcon} alt="Serviços" />
            Serviços
          </li>
          <li 
            onClick={() => {
              setTitulo("Configurações");
              setFiltro("configuracoes");
              setPagina("configuracoes");
            }} 
            className={`filtro-menu-lateral ${filtro === "configuracoes" ? "ativo" : ""}`}
          >
            <img src={configuracoesIcon} alt="Configurações" />
            Configurações
          </li>
        </ul>
      </section>
      <div className='minhas-tarefas'>
        <main>
          <Header
            titulo={titulo}
            setPagina={setPagina}
            setTitulo={setTitulo}
            setFiltro={setFiltro}
          />
          {paginas[pagina]}
        </main>
      </div>
    </PagBase>
  );
}

export default PaginaBase;
